public class Part3 {
    static int findStopIndex(String dna, int index) {
        
        int stop1 = dna.indexOf("tga", index);
        if ( stop1 == -1 || ( stop1-index ) % 3 != 0 ) {
            stop1 = dna.length();
        }
        
        int stop2 = dna.indexOf("taa", index);
        if ( stop2 == -1 || ( stop2-index ) % 3 != 0 ) {
            stop2 = dna.length();
        }
        
        int stop3 = dna.indexOf("tag", index);
        if ( stop3 == -1 || ( stop3-index ) % 3 != 0 ) {
            stop3 = dna.length();
        }
        
        return Math.min( stop1, Math.min(stop2, stop3) );
    }
    static StorageResource storeAll(String dna) {
        String dnaLow = dna.toLowerCase();
        int start = 0;
        StorageResource genes = new StorageResource();
        while (true) {
            int loc = dnaLow.indexOf( "atg", start );
            if ( loc == -1 ) {
                break;
            }
            int stop = findStopIndex( dnaLow, loc+3 );
            if ( stop != dna.length() ) {
                genes.add( dna.substring(loc, stop+3) );
                start = stop + 3;
            } else {
                start = start + 3;
            }
        }
        return genes;
    }
    static void processGenes(StorageResource sr){
        int countAbove9=0;
        int maxLen=0;
        int count=0;
        int countRatio=0;
        for (String s:sr.data()){
            System.out.println(s);
            count+=1;
            if (s.length()>60) {
                //System.out.println(String.format("The length of %s is %d",s,s.length()));
                countAbove9+=1;
            }
            Part2 part2=new Part2();
            if (part2.cgRatio(s)>0.35) countRatio+=1;//System.out.println(String.format("Ratio of %s is %.3f",s,part2.cgRatio(s)));
            if (s.length()>maxLen) maxLen=s.length();
        }   
        System.out.println(String.format("The number of DNA's with the length more than 60 is: %d",countAbove9));
        System.out.println(String.format("The length of the longest DNA is: %d",maxLen));
        System.out.println(sr.size());
        System.out.println(countRatio);
    }    
    static void testProcessGenes(){
        StorageResource test=new StorageResource();
        test.add("ATCgccATC");//len 9, ratio=5/9
        test.add("ATCGcGATCG");//len 10,ratio 6/10
        test.add("ATCt");//len 4, ratio 1/4
        test.clear();
        //test.add("");
        processGenes(storeAll(""));
    }
}
